import random
from math import e
import time

def metaheurystyka(ogr_sc_idx, ogr_sc_war, kolumny, wiersze, polaczenia, meta_plansza, T = 100, alfa = 0.95, iter = 500000, pow = 500):
    idx = indeksy(meta_plansza)
    aktualna_plansza = zamien_elementy(meta_plansza.copy(), idx)
    aktualny_wynik = f(ogr_sc_idx, ogr_sc_war, kolumny, wiersze, polaczenia, aktualna_plansza)

    powtozenia = 0
    for i in range(iter):
        temp_plansza = zamien_elementy(aktualna_plansza.copy(), idx)
        temp_wynik = f(ogr_sc_idx, ogr_sc_war, kolumny, wiersze, polaczenia, temp_plansza)

        if temp_wynik >= aktualny_wynik:
            aktualna_plansza = temp_plansza
            aktualny_wynik = temp_wynik
            powtozenia = 0
        else:
            try:
                if e ** (- abs((temp_wynik - aktualny_wynik) / (T))) > random.random():
                    # print(True, i, temp_wynik, aktualny_wynik)
                    aktualna_plansza = temp_plansza
                    aktualny_wynik = temp_wynik
                    powtozenia = 0
                else:
                    # print(False, i, temp_wynik, aktualny_wynik)
                    powtozenia += 1
            except OverflowError:
                print('duza wartosc rozkladu')
                powtozenia += 1

        T = T * alfa

        if powtozenia > pow:
            print(f'przy T = {T}, zbyt wiele czasu nie bylo zmian')
            return aktualna_plansza, aktualny_wynik
    return aktualna_plansza, aktualny_wynik





def f(ogr_sc_idx, ogr_sc_war, kolumny, wiersze, polaczenia, temp_plansza):
    wynik_zar = [0 for _ in range(len(temp_plansza))]
    for i in range(len(polaczenia)):
        if type(temp_plansza[i]) != str:
            temp = 0
            for j in range(len(polaczenia)):
                if type(temp_plansza[j]) != str:
                    temp += temp_plansza[j] * polaczenia[i][j]
            wynik_zar[i] = min(1, temp)

    wynik_sc = ogr_sc_war.copy()
    for i in range(len(ogr_sc_war)):
        for j in ogr_sc_idx[i]:
            if temp_plansza[j - 1] == 1:
                wynik_sc[i] -= 1

    wynik_kol = []
    for i in kolumny:
        temp = 0
        for j in i:
            if temp_plansza[j - 1] == 1:
                temp += 1
        if temp <= 1:
            temp = 0
        wynik_kol.append(temp)

    wynik_wie = []
    for i in wiersze:
        temp = 0
        for j in i:
            if temp_plansza[j - 1] == 1:
                temp += 1
        if temp <= 1:
            temp = 0
        wynik_wie.append(temp)



    # print(wynik_zar)
    # print(wynik_sc)
    # print(wynik_kol)
    # print(wynik_wie)
    wynik = 0
    for i in wynik_zar:
        wynik += i
    for i in wynik_sc:
        wynik -= abs(i) * 0.3
    for i in wynik_kol:
        wynik -= i * 0.5
    for i in wynik_wie:
        wynik -= i * 0.5

    return wynik


def max_wynik(plansza):
    wynik = 0
    for i in plansza:
        if i == 0:
            wynik += 1
    return wynik


def indeksy(tablica):
    indeksy = []
    for i in range(len(tablica)):
        if type(tablica[i]) == int:
            indeksy.append(i)
    return indeksy


